// src/components/StudentList.js
import React from 'react';

const StudentList = ({ students }) => {
    return (
        <div>
            <h2>Student List</h2>
            <ul>
                {students.map((student) => (
                    <li key={student.id}>
                        {student.name} ({student.department}) - Semester {student.semester}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default StudentList;
